INSERT INTO hippohippogo_db.pages_connection (id, referred, referring) VALUES (270046, 'Chilwell has four years left on his contract and Leicester are under no pressure to sell.     Chilwell has established himself as England’s first-choice left back since making his international debut against Switzerland in September 2018.     Convincing Leicester to sell Chigwell will not be easy. They have shown in the past that they will not be bullied or sell their players cheaply. They are also five points and one place above Chelsea in third in the Premier League and on course for Champions League qualification.      Frank Lampard has wanted to sign a left back ever since he became Chelsea manager last summer. Chelsea are willing to listen to offers for Emerson and Marcos Alonso.     While other clubs have been cutting their transfer budgets, Chelsea owner Roman Abramovich is willing to continue to back Lampard when it comes to signing the right new players this summer.     A £49m deal for Timo Werner was agreed in principle with RB Leipzig yesterday and Lampard will have more money to spend.     He did not sign anyone in January but a £34m deal was agreed in February with Ajax for Hakim Ziyech to move to Stamford Bridge next month.     Chelsea were banned from making any signings last summer although in July they were allowed to take up their £40m option to turn Mateo Kovacic’s loan from Real Madrid into a permanent transfer.', 'skysports.com');
